import {
    AuthorizationCodeClient,
    ClientConfiguration,
} from "@azure/msal-common";

export class HybridSpaAuthorizationCodeClient extends AuthorizationCodeClient {
    constructor(config: ClientConfiguration) {
        super(config);
        this.includeRedirectUri = false;
    }
}
